import React from 'react';
import Form from 'react-bootstrap/Form';
import InputMask from 'react-input-mask';
import '../Styles/HostForm4.css';

export class HostForm2 extends React.Component{
    constructor(props){
      super(props);
    }

    render(){

      return(
        <Form>
          <Form.Row>
            <Form.Group controlId="formEmail">
              <Form.Label>Email address</Form.Label>
              <Form.Control type="email" placeholder="email@example.com"/>
              <Form.Text className="text-muted"> This will be the address OpenSpace and users interested in your space will use to communicate with you.</Form.Text>
            </Form.Group>
          </Form.Row>
          <Form.Row>
              <Form.Group id="col1"as={Form.Col} controlId="formPhone">
                <Form.Label>Phone number</Form.Label>
                <Form.Control type="phone" placeholder="(123)456-789"/>
                <Form.Text className="text-muted"> This will be phone number users interested in your space will use to communicate with you.</Form.Text>
              </Form.Group>

              <Form.Group id="col2"as={Form.Col} controlId="formPhoneTypes">
                <Form.Label>type</Form.Label>
                <Form.Control as="select">
                  <option>phone type...</option>
                  <option>home</option>
                  <option>mobile</option>
                  <option>work</option>
                </Form.Control>
              </Form.Group>
          </Form.Row>
        </Form>


      );
    }
  }

  export default HostForm2;
